import React from "react";

const Header = () => {
  return (
    <div className="bg-white border-b border-gray-200 px-6 py-4">
      <div className="flex items-center">
        <h1 className="text-lg font-semibold text-gray-900">My Notes</h1>
      </div>
    </div>
  );
};

export default Header;
